import React, {Component} from 'react';

class GameState extends Component {
    constructor(props) {
      super(props);
      this.state={
        qBank1: [],
        numberq1: 1
      }
    }

  render() {
    return (
      <div className="score-board">
        <div className="score">
          {console.log(this.state.numberq1)}
        </div>
      </div>
    );
  }

}

export default GameState;
